ControlPropertyState.AutoRuleBindingString:
If(
    IsBlank(dtpActCRImplDTST15.SelectedDate),
    Notify(
        "Please fill in all required fields",
        NotificationType.Error
    ),
     // Define a variable to hold the existing record
    UpdateContext(
        {
            existingRecordST15: LookUp(
                ECN_Stage15,
                ES015_ECNReference.Value = SelectedECNNo.'ECN NO.'
            )
        }
    );

// Check if the record exists
If(
        !IsBlank(existingRecordST15),
    // Update the existing record
        Patch(
            ECN_Stage15,
            existingRecordST15,
            {
                ES015_Actual_Change_Impl_Date: dtpActCRImplDTST15.SelectedDate,
                ES015_ECNReference: {
                    Value: SelectedECNNo.'ECN NO.',
                    Id: LookUp(
                        ECN_Stage1,
                        'ECN NO.' = SelectedECNNo.'ECN NO.'
                    ).ID
                },
                ECN_ModifyBy: {
                    Value: varUser.User_Name,
                    Id: LookUp(
                        ECN_UserMaster,
                        User_Id = varUser.User_Id
                    ).ID
                }
            }
        ),
    // Insert a new record if it does not exist
        Patch(
            ECN_Stage4,
            Defaults(ECN_Stage4),
            {
                Title: SelectedECNNo.'ECN NO.',
                ES004_ZohoProjectID: txtZohoProjectIDST4.Text,
                ES004_ECNReference: {
                    Value: SelectedECNNo.'ECN NO.',
                    Id: LookUp(
                        ECN_Stage1,
                        'ECN NO.' = SelectedECNNo.'ECN NO.'
                    ).ID
                },
                ECN_ModifyBy: {
                    Value: varUser.User_Name,
                    Id: LookUp(
                        ECN_UserMaster,
                        User_Id = varUser.User_Id
                    ).ID
                }
            }
        )
    );

// Show success or error messages and update ECN_Stage1 currentstatus
If(
        !IsEmpty(Errors(ECN_Stage4)),
        Notify(
            "An error occurred while saving the record.",
            NotificationType.Error
        ),
        Patch(
            ECN_Stage1,
            LookUp(
                ECN_Stage1,
                'ECN NO.' = SelectedECNNo.'ECN NO.'
            ),
            {
                Current_StageId: {
                    Value: "Stage5",
                    Id: LookUp(
                        ECN_StageMaster,
                        Stage_Id = 5
                    ).ID
                }
            }
        );
        Notify(
            "Record saved successfully!",
            NotificationType.Success
        )
    );
    Navigate(frmHome)
)
